import React from 'react';
import {SafeAreaView, StatusBar, Text, View} from 'react-native';

const App = () => {
 return (
   <SafeAreaView>
     <StatusBar />
     <View>
       <Text style={{fontSize: 24}}></Text>
     </View>
   </SafeAreaView>
 );
};

export default App;
